/*Table structure for table `user_reports` */

DROP TABLE IF EXISTS `user_reports`;

CREATE TABLE `user_reports` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `sender_id` int(10) unsigned NOT NULL,
  `reciever_id` int(10) unsigned NOT NULL,
  `type` enum('fake_profile','bad_language','offensive_content','other') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'other',
  `message` text COLLATE utf8_unicode_ci,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `user_reports` */

/*Table structure for table `users` */

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `fname` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `lname` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `full_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `email` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `password` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `phone_number` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `dob` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `gender` enum('male','female') COLLATE utf8_unicode_ci DEFAULT 'male',
  `marrital_status` enum('single','divorced','widowed') COLLATE utf8_unicode_ci DEFAULT 'single',
  `religion_cast` enum('shia','sunni','just_muslim') COLLATE utf8_unicode_ci DEFAULT 'just_muslim',
  `height` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `country` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `ethnicity` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `nationality` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `language` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `profession` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `education` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `education_detail` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL,
  `religion` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `my_status` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `about_me` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `latitude` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `longitude` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `role_id` int(10) unsigned DEFAULT '2',
  `is_completed_profile` enum('0','1') COLLATE utf8_unicode_ci DEFAULT '0',
  `notify_new_matches` enum('0','1') COLLATE utf8_unicode_ci DEFAULT '1',
  `notify_message` enum('0','1') COLLATE utf8_unicode_ci DEFAULT '1',
  `notify_booster` enum('0','1') COLLATE utf8_unicode_ci DEFAULT '1',
  `status` enum('0','1') COLLATE utf8_unicode_ci DEFAULT '1',
  `is_rewind` enum('0','1') COLLATE utf8_unicode_ci DEFAULT '0',
  `rewind_date` datetime DEFAULT NULL,
  `current_city` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `current_country` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `remember_token` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `role_id` (`role_id`),
  CONSTRAINT `users_ibfk_1` FOREIGN KEY (`role_id`) REFERENCES `roles` (`id`)
